import { getChecksumConfiguration, resolveChecksumRuntimeConfig } from "@smithy/types/dist-cjs/extensions/checksum";
export const getDefaultClientConfiguration = (runtimeConfig) => {
    return {
        ...getChecksumConfiguration(runtimeConfig),
    };
};
export const resolveDefaultRuntimeConfig = (config) => {
    return {
        ...resolveChecksumRuntimeConfig(config),
    };
};
